import React, { useState } from 'react';
import {Button} from '@mui/material'


export function FileUpload() {

    return (
        <form onSubmit={handleSubmit}>
            <input 
                type="file" 
                onChange={(e) => setFile(e.target.files[0])} 
            />
            <button type="submit">Upload</button>
        </form>
    );
}
